import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h2>GOT QUESTIONS?</h2>
        <p>
          The easiest thing to do is email us at <a href="mailto:frunchyresto@gmail.com">frunchyresto@gmail.com</a>
        </p>
      </div>
    );
  }
}

export default Contact;
